      w = window.innerWidth;
      h = window.innerHeight;
      this.scene = new BABYLON.Scene(this.engine);
      this.scene.clearColor = new BABYLON.Color3(0, 0, 0);
      this.scene.autoClear = false;
      this.camera = new BABYLON.FreeCamera('maincamera', new BABYLON.Vector3(0, 5, -10), this.scene);
      this.camera.setTarget(new BABYLON.Vector3.Zero());
      this.camera.attachControl(this.canvas, false);
      this.bgScene = new BABYLON.Scene(this.engine);
      this.bgScene.clearColor = new BABYLON.Color3(0, 0, 0);
      this.bgCamera = new BABYLON.FreeCamera('backgroundCamera', new BABYLON.Vector3(0, 0, 0), this.bgScene);
      this.bgCamera.mode = 1;
      this.bgCamera.setTarget(new BABYLON.Vector3.Zero());
      this.bgCamera.orthoLeft = -w * .5;
