(function() {
  'use strict';
  var Config, loading, responsive, ua, uiInteraction;

  Config = require("./modules/Config");

  responsive = require("./modules/Responsive");

  uiInteraction = require("./modules/UIInteraction");

  loading = require("./modules/Loading");

  ua = navigator.userAgent.toLowerCase();

  $(function() {
    var _ua, isSend;
    loading.init();
    _ua = (function() {
      return {
        Blink: window.chrome
      };
    })();
    if (_ua.Blink) {
      document.body.style.webkitTransform = "scale(1)";
    }
    FLAutoKerning.process($('p span'));
    FLAutoKerning.process($('.kerning'));

    /* layout */
    responsive.switchImg();
    if ($(window).width() > 640) {
      responsive.coverSizeFix();
    }
    $(window).on("resize", function() {
      responsive.switchImg();
      if ($(window).width() > 640) {
        return responsive.coverSizeFix();
      }
    });

    /* parallax */

    /*
    if not (ua.match('iphone') or ua.match('android') or ua.match('ipod') or ua.match('ipad'))
      $(window).on 'scroll', ->
        console.log 'scroll'
        value = $(this).scrollTop()
        $('#contents').css {
          backgroundPositionY: -value / 7 + 'px'
        }
     */

    /* click */
    if (ua.match('iphone') || ua.match('android') || ua.match('ipod') || ua.match('ipad')) {
      $('.to-top-wrap').on('touchstart', function() {
        return $("html, body").animate({
          scrollTop: 0
        }, 800, 'easeInOutCirc');
      });
    } else {
      $('.to-top-wrap').on('click', function() {
        return $("html, body").animate({
          scrollTop: 0
        }, 800, 'easeInOutCirc');
      });
    }
    $('.scroll-down-wrap').on('click', function() {
      var windowHeight;
      windowHeight = $(window).innerHeight();
      return $('body, html').animate({
        scrollTop: windowHeight
      }, 800, 'easeInOutCubic');
    });
    $('.btn-about-wrap, .btn-about').on('click', function() {
      $('#about').css({
        display: 'block'
      }).transition({
        opacity: 1
      }, 200);
      return $('#inner-wrap').transition({
        opacity: 0
      }, 200, function() {
        $(this).css({
          display: 'none'
        });
        return $('body, html').animate({
          scrollTop: 0
        }, 0, function() {
          return $('#about').css({
            position: 'absolute'
          });
        });
      });
    });
    $('#about .close-wrap').on('click', function() {
      $('#about').transition({
        opacity: 0
      }, 200, function() {
        return $(this).css({
          display: 'none'
        });
      });
      $('#inner-wrap').css({
        display: 'block'
      }).transition({
        opacity: 1
      }, 200, function() {
        return $('#about').css({
          position: 'fixed'
        });
      });
      if (!(ua.match('iphone') || ua.match('android') || ua.match('ipod') || ua.match('ipad'))) {
        return $('body').css({
          overflow: 'auto'
        });
      }
    });
    $('.more-btn').on('click', function() {
      if ($('.down-tri').hasClass('open')) {
        $('#note-box').transition({
          height: 260
        }, 600);
        $('.down-tri').removeClass('open');
        return $(this).text('MORE');
      } else {
        $('#note-box').transition({
          height: 3500
        }, 600);
        $('.down-tri').addClass('open');
        return $(this).text('CLOSE');
      }
    });
    isSend = false;
    $('.radio-wrap').on('click', function() {
      if ($(this).find('.radio').hasClass('on')) {
        $(this).find('.radio').removeClass('on');
        $('.send-btn, .send-btn-sp').addClass('off');
        return isSend = false;
      } else {
        $(this).find('.radio').addClass('on');
        $('.send-btn, .send-btn-sp').removeClass('off');
        return isSend = true;
      }
    });
    $('.send-btn').on('mouseenter', function() {
      if (isSend) {
        return $(this).transition({
          filter: 'brightness(1.1)'
        });
      }
    });
    $('.send-btn').on('mouseleave', function() {
      if (isSend) {
        return $(this).transition({
          filter: 'brightness(1.0)'
        });
      }
    });
    $('.send-btn, .send-btn-sp').on('click', function() {
      if (!isSend) {
        return false;
      }
    });

    /* hover */
    if (!(ua.match('iphone') || ua.match('android') || ua.match('ipod') || ua.match('ipad'))) {
      $('.close-wrap').on('mouseenter', function() {
        $(this).find('.close').stop(true, true).transition({
          rotate: '135deg'
        });
        return $(this).find('.close-reverse').stop(true, true).transition({
          rotate: '-135deg'
        });
      });
      $('.close-wrap').on('mouseleave', function() {
        $(this).find('.close').stop(true, true).css({
          rotate: '45deg'
        });
        return $(this).find('.close-reverse').stop(true, true).css({
          rotate: '-45deg'
        });
      });
      $('.btn-about-wrap').on('mouseenter', function() {
        $(this).find('.btn-about').stop(true, true).transition({
          color: '#fff',
          background: '#000'
        }, 400);
        $(this).find('.btn-about-tri').stop(true, true).transition({
          opacity: 0,
          left: "4px",
          rotateX: "360deg"
        }, 400);
        return $(this).find('.btn-about-tri-on').stop(true, true).transition({
          opacity: 1.0,
          left: "4px",
          rotateX: "360deg"
        }, 400);
      });
      $('.btn-about-wrap').on('mouseleave', function() {
        $(this).find('.btn-about').transition({
          color: 'black',
          background: '#f1ff00'
        }, 150);
        $(this).find('.btn-about-tri').transition({
          opacity: 1.0,
          left: "0",
          rotateX: "0deg"
        }, 150);
        return $(this).find('.btn-about-tri-on').transition({
          opacity: 0,
          left: "0",
          rotateX: "0deg"
        }, 150);
      });
      $('.btn-about').on('mouseenter', function() {
        return $(this).find('.tri').stop(true, true).transition({
          left: '4px',
          rotateX: '360deg'
        });
      });
      $('.btn-about').on('mouseleave', function() {
        return $(this).find('.tri').stop(true, true).transition({
          left: '0'
        }, function() {
          return $(this).css({
            rotateX: '0deg'
          });
        });
      });
      $('.send-btn').on('mouseenter', function() {
        if (isSend) {
          return $(this).find('.tri').stop(true, true).transition({
            left: '4px',
            rotateX: '360deg'
          });
        }
      });
      $('.send-btn').on('mouseleave', function() {
        if (isSend) {
          return $(this).find('.tri').stop(true, true).transition({
            left: '0'
          }, function() {
            return $(this).css({
              rotateX: '0deg'
            });
          });
        }
      });
      $('.ma-info-wrap').on('mouseenter', function() {
        $('.ma-info-btn').transition({
          color: '#fff',
          background: '#000'
        }, 400);
        $('.ma-info-btn').find('.ma-info-tri').transition({
          opacity: 0,
          left: "+=4px"
        }, 400);
        return $('.ma-info-btn').find('.ma-info-tri-on').transition({
          opacity: 1.0,
          left: "+=4px"
        }, 400);
      });
      $('.ma-info-wrap').on('mouseleave', function() {
        $('.ma-info-btn').transition({
          color: 'black',
          background: '#fff'
        }, 150);
        $('.ma-info-btn').find('.ma-info-tri').transition({
          opacity: 1.0,
          left: "-=4px"
        }, 150);
        return $('.ma-info-btn').find('.ma-info-tri-on').transition({
          opacity: 0,
          left: "-=4px"
        }, 150);
      });

      /*
      $('.news02').on 'mouseenter', ->
        $('.to-present').css {display: 'block'}
          .transition {
            opacity: 1
            right: "-=4px"
          }, 200
      
      $('.news02').on 'mouseleave', ->
        $('.to-present').transition {
          opacity: 0
          right: "+=4px"
        }, 200, ->
          $(this).css {display: 'block'}
       */
      $('.sns-wrap .tw, .sns-wrap .fb').on('mouseenter', function() {
        var $elm;
        $elm = $(this).children('img');
        $(this).stop(true, true).transition({
          filter: 'brightness(1.2)'
        }, 400);
        return uiInteraction.rollUp($elm);
      });
      $('.sns-wrap .tw, .sns-wrap .fb').on('mouseleave', function() {
        var $elm;
        $elm = $(this).children('img');
        $(this).stop(true, true).transition({
          filter: 'brightness(1.0)'
        }, 150);
        return uiInteraction.down($elm);
      });
      $('#cover .sns, #ma-footer-sns-wrap .sns').on('mouseenter', function() {
        var $elm;
        $elm = $(this).find('.icon');
        $(this).stop(true, true).transition({
          filter: 'brightness(1.2)'
        }, 400);
        return uiInteraction.rollUp($elm);
      });
      $('#cover .sns, #ma-footer-sns-wrap .sns').on('mouseleave', function() {
        var $elm;
        $elm = $(this).find('.icon');
        $(this).stop(true, true).transition({
          filter: 'brightness(1.0)'
        }, 150);
        return uiInteraction.down($elm);
      });
      $('#footer-sns-wrap .sns').on('mouseenter', function() {
        $(this).find('.icon').stop(true, true).transition({
          rotateY: '360deg',
          top: '-=4px',
          opacity: 0
        }, 400);
        $(this).find('.icon.on').stop(true, true).transition({
          rotateY: '360deg',
          top: '-=4px',
          opacity: 1
        }, 400);
        return $(this).find('.btn').stop(true, true).transition({
          background: "black"
        }, 400);
      });
      $('#footer-sns-wrap .sns').on('mouseleave', function() {
        $(this).find('.icon').stop(true, true).transition({
          rotateY: '0'
        }, 0).transition({
          top: 0,
          opacity: 1
        }, 150);
        $(this).find('.icon.on').stop(true, true).transition({
          rotateY: '0'
        }, 0).transition({
          top: 0,
          opacity: 0
        }, 150);
        return $(this).find('.btn').stop(true, true).transition({
          background: "#f1ff00"
        }, 150);
      });
      $('.to-top-wrap').on('mouseenter', function() {
        var $elm;
        $elm = $(this).children('.to-top-tri');
        return uiInteraction.rollUp($elm);
      });
      $('.to-top-wrap').on('mouseleave', function() {
        var $elm;
        $elm = $(this).children('.to-top-tri');
        return uiInteraction.down($elm);
      });
    }

    /* custum scroll bar */
    if (!(ua.match('iphone') || ua.match('android') || ua.match('ipod') || ua.match('ipad'))) {
      $('#note-box').mCustomScrollbar({
        autoHideScrollbar: false,
        alwaysShowScrollbar: 2
      });
    }
    if (ua.match('iphone') || ua.match('android') || ua.match('ipod') || ua.match('ipad')) {
      return $('#note-box').removeClass('mCustomScrollbar');
    }
  });

}).call(this);
